import React from 'react'
import { Line } from 'react-chartjs-2'
import {Chart as ChartJS} from 'chart.js/auto'


const LineChart = () => {
    return (
        <div>
            <Line
                data={{
                    labels: ['Actual Velocity', 'Expected Velocity'],
                    datasets:[{
                        label: 'Historical Team Performance',
                        data: [23, 8, 17, 22, 6],
                        backgroundColor: [
                            'rgba(255, 99, 132, 0.2)',
                            'rgba(54, 162, 235, 0.2)',
                        ],
                        borderColor: [
                            'rgba(255, 99, 132, 1)',
                            'rgba(54, 162, 235, 1)',
                        ],
                        borderWidth: 1
                    }]
                }}
                height={400}
                width={10}
                options={{maintainAspectRatio: false,}}
            />
        </div>
    )
}

export default LineChart;
